import { useEffect } from 'react';
import './App.scss';

function App() {
  const handleClick=async(event)=>{
    event.preventDefault();
    useEffect()
    try{
      const response = await fetch("https://jsonkeeper.com/b/P2VO")
      console.log(response);
    }
    catch(error){
      console.log(error);
    }
  }
  return (
    <div className="App">
      <button onClick={(e)=>handleClick()}>Hiii</button>
    </div>
  );
}

export default App;
